import React from "react";
import axios from 'axios';

const {data: birthdayData} = axios.get(`${process.env.URL_SERVER}/api/getBirthday`);
console.log(birthdayData);
export default function Birthday() {
    return(
        <div>Birthday</div>
    )
}
